import React from 'react'
import { Row, Col, Image, ListGroup, Button, Card } from 'react-bootstrap';

const Contact = () => {
    return (
    <Row>
        <Col md={6} xs={12}>
            <Image src={'b-link-p.jpg'} rounded responsive />
        </Col>
    </Row>
    )
}

export default Contact
